      <div className="footer-links">
        {/* Replace this with Maria’s real GitHub if available */}
        <a href="https://github.com/maria" target="_blank" rel="noopener noreferrer">Maria GitHub</a>
        <span>|</span>
        <a href="https://github.com/yazandahood8" target="_blank" rel="noopener noreferrer">Yazan GitHub</a>
      </div>
    </footer>
  );
};

export default Footer;
